Insert into GEOLOGICALFEATURE (ID,FEATURETYPE_ID,IDENTIFIER,DESCRIPTIVENAME,TEXTDESCRIPTION,GEOLOGICALCONCEPT_ID,DATASET_ID,ROLE_ID) values (167775491936281998,28,0,'contact aureole schist - cordierite zone','Cordierite schist, schistose cordierite hornfels and cordierite hornfels. Includes quartz-rich biotite schist and hornfels.',16777549126932953,1,1679161121580275464);
Insert into GEOLOGICALFEATURE (ID,FEATURETYPE_ID,IDENTIFIER,DESCRIPTIVENAME,TEXTDESCRIPTION,GEOLOGICALCONCEPT_ID,DATASET_ID,ROLE_ID) values (167775491107838594,28,0,'Regional biotite zone','Slate, psammite, phyllite, fine-grained schist with biotite.',1677754911513320507,1,1679161121580275464);
Insert into GEOLOGICALFEATURE (ID,FEATURETYPE_ID,IDENTIFIER,DESCRIPTIVENAME,TEXTDESCRIPTION,GEOLOGICALCONCEPT_ID,DATASET_ID,ROLE_ID) values (167775491107838781,28,0,'contact aureole hornfels','Interlayered black mudstone with minor siliceous siltstone and calcareous sandstone;  base is characterised by strong chlorite +/- stilpnomelane alteration. Unit contains a diverse range of Early Cambrian acritach fossils, and other fossils from within interbedded siliceous chert bands. Rock converted to hornfels in contact metamorphic aureole',167775491107838706,1,1679161121580275464);
Insert into GEOLOGICALFEATURE (ID,FEATURETYPE_ID,IDENTIFIER,DESCRIPTIVENAME,TEXTDESCRIPTION,GEOLOGICALCONCEPT_ID,DATASET_ID,ROLE_ID) values (16777549126934759,28,0,'hornfels biotite zone','Biotite zone hornfels',16777549126932953,1,1679161121580275464);
