Insert into GEOLOGICALFEATURE (ID,FEATURETYPE_ID,IDENTIFIER,DESCRIPTIVENAME,TEXTDESCRIPTION,GEOLOGICALCONCEPT_ID,DATASET_ID,ROLE_ID) values (167775491107838810,28,0,'contact metamorphic hornfels','hornfels formed from Quartz-biotite-graphite schist, black, laminated: thin graded quartz and pelite layers are relict bedding; pelitic layers contain biotite; graphitic material. Black, greasy texture; disseminated pyrrhotite and pyrite mineralization; from a mix of Albion Formation and minor Magdala Volcanics precursors? nonmagnetic; contact metamorphic aureole rocks.',1677754911513321191,1,1679161121580275464);
Insert into GEOLOGICALFEATURE (ID,FEATURETYPE_ID,IDENTIFIER,DESCRIPTIVENAME,TEXTDESCRIPTION,GEOLOGICALCONCEPT_ID,DATASET_ID,ROLE_ID) values (167775491107838814,28,0,'contact aureole hornfels','hornfels--spotted with cordierite',1677754911513321305,1,1679161121580275464);
Insert into GEOLOGICALFEATURE (ID,FEATURETYPE_ID,IDENTIFIER,DESCRIPTIVENAME,TEXTDESCRIPTION,GEOLOGICALCONCEPT_ID,DATASET_ID,ROLE_ID) values (167775491107838881,28,0,null,'750m of micaceous mudstone: red; with thin interbeds of yellowish quartzo-micaceous sandstone; laminated; rippled surfaces, mudcracks and bioturbation; poorly outcropping. Sparse fossil fauna of  ostracods, brachiopods, and fish spines, teeth and scales.',1677754911513321305,1,1679161121580275464);
Insert into GEOLOGICALFEATURE (ID,FEATURETYPE_ID,IDENTIFIER,DESCRIPTIVENAME,TEXTDESCRIPTION,GEOLOGICALCONCEPT_ID,DATASET_ID,ROLE_ID) values (167775491107848330,28,0,null,'150m of laminated mudstone, 30m of siliceous siltstone. Black shale, laminated siltstone: thinly bedded; thin sandstone beds; rare bioturbated mudstone; dark grey weathered to various pale colours',167775491107848316,1,1679161121580275464);
