-- @@Version {1.0} (this version determines if we should run this script. If a older version exist, we will require the user to empty out the database)


CREATE OR REPLACE PROCEDURE DROP_TABLE(TabName in Varchar2) 
IS
temp number:=0;
tes VARCHAR2 (200) := TabName;
drp_stmt VARCHAR2 (200):=null;
BEGIN
select count(*) into temp from user_tables where TABLE_NAME = tes ;
if temp =1 then
drp_stmt := 'Drop Table '||tes;
EXECUTE IMMEDIATE drp_stmt;
end if;
EXCEPTION
WHEN OTHERS THEN
raise_application_error(-20001,'An error was encountered - '||SQLCODE||' -ERROR- '||SQLERRM);
END DROP_TABLE;
/


CREATE OR REPLACE PROCEDURE SP_SPATIAL_DATA AS 
BEGIN
declare 
  cursor structure_cur is 
    select id,wkt from Z_GEOSTRUCTURE order by id; 
     
   cursor unit_cur is 
    select id,wkt from Z_GEOUNIT order by id; 
     
  geom sdo_geometry; 
  myid number; 
  BEGIN
 FOR cur_rec in structure_cur LOOP 
    geom := SDO_GEOMETRY(cur_rec.wkt,4283); 
    myid := cur_rec.id; 
    update mappedfeature_geolstructure set shape = geom where id=myid; 
  END LOOP; 
  
  FOR cur_rec in unit_cur LOOP 
    geom := SDO_GEOMETRY(cur_rec.wkt,4283); 
    myid := cur_rec.id; 
    update mappedfeature_geolunit set shape = geom where id=myid; 
  END LOOP; 
  END;
END SP_SPATIAL_DATA;
/
