  CREATE OR REPLACE FORCE VIEW "contact" ("id", "contacttype", "observationmethod", "observationmethod_codespace", "purpose") AS 
  SELECT TO_CHAR(gf.id)            AS id,
    cc.urn                         AS contacttype,
    'urn:ogc:def:nil:OGC::missing' AS observationmethod,
    'http://urn.opengis.net/'      AS observationmethod_codespace,
    'typicalNorm'                  AS purpose
  FROM geologicalfeature gf,
    geologicalfeature_attribute gfa,
    classificationcode_urn cc
  WHERE gf.id           = gfa.geologicalfeature_id
  AND gf.featuretype_id = 34
  AND gfa.name_id       = 103884
  AND gfa.value01_id    = cc.classificationcode_id
  AND cc.urndomain      = 'CGI';
 

  CREATE OR REPLACE FORCE VIEW "density" ("id", "physicaldescription_id", "value01", "value01_uom", "value02", "value02_uom") AS 
  SELECT TO_CHAR(gfa.id)              AS id,
    TO_CHAR(gfa.geologicalfeature_id) AS physicaldescription_id,
    qv1.value                         AS value01,
    ccv1.urn                          AS value01_uom,
    qv2.value                         AS value02,
    ccv2.urn                          AS value02_uom
  FROM geologicalfeature_attribute gfa
  LEFT JOIN (quantityvalue qv2
  LEFT JOIN
    (SELECT classificationcode_urn.classificationcode_id,
      classificationcode_urn.urn,
      classificationcode_urn.urndomain
    FROM classificationcode_urn
    WHERE classificationcode_urn.urndomain = 'OGC'
    ) ccv2
  ON qv2.uom_id     = ccv2.classificationcode_id)
  ON gfa.value02_id = qv2.id,
    classificationcode cc,
    quantityvalue qv1,
    classificationcode_urn ccv1
  WHERE gfa.name_id = cc.id
  AND lower(cc.name) LIKE '%density%'
  AND gfa.value01_id = qv1.id
  AND qv1.uom_id     = ccv1.classificationcode_id
  AND ccv1.urndomain = 'OGC'
  UNION
  SELECT TO_CHAR(ema.id)          AS id,
    TO_CHAR(ema.earthmaterial_id) AS physicaldescription_id,
    qv1.value                     AS value01,
    ccv1.urn                      AS value01_uom,
    qv2.value                     AS value02,
    ccv2.urn                      AS value02_uom
  FROM earthmaterial_attribute ema
  LEFT JOIN (quantityvalue qv2
  LEFT JOIN
    (SELECT classificationcode_urn.classificationcode_id,
      classificationcode_urn.urn,
      classificationcode_urn.urndomain
    FROM classificationcode_urn
    WHERE classificationcode_urn.urndomain = 'OGC'
    ) ccv2
  ON qv2.uom_id     = ccv2.classificationcode_id)
  ON ema.value02_id = qv2.id,
    classificationcode cc,
    quantityvalue qv1,
    classificationcode_urn ccv1
  WHERE ema.name_id = cc.id
  AND lower(cc.name) LIKE '%density%'
  AND ema.value01_id = qv1.id
  AND qv1.uom_id     = ccv1.classificationcode_id
  AND ccv1.urndomain = 'OGC';
 

  CREATE OR REPLACE FORCE VIEW "DENSITY" ("ID", "PHYSICALDESCRIPTION_ID", "VALUE01", "VALUE01_UOM", "VALUE02", "VALUE02_UOM") AS 
