  SELECT TO_CHAR(ge.id)                            AS id,
	'gsml.geologicevent.' || TO_CHAR(ge.id) 	   AS full_id,
    TO_CHAR(gfa.geologicalfeature_id)              AS geologicalfeature_id,
    ccmin.urn                                      AS minage,
    ccmax.urn                                      AS maxage,
    'urn:cgi:classifierScheme:ICS:StratChart:2008' AS codespace,
    gfa.sequence_no                                AS eventorder,
    TO_CHAR(pe."geologicalfeature_id")             AS preferredevent_id
  FROM geologicalfeature_attribute gfa,
    ageinterval ai,
    classificationcode_urn ccmin,
    classificationcode_urn ccmax,
    geologicalevent ge
  LEFT JOIN "preferredevent" pe
  ON ge.id                 = pe."id"
  WHERE gfa.value01_id     = ge.id
  AND ge.id                = ai.geologicalevent_id
  AND ai.minageinterval_id = ccmin.classificationcode_id
  AND ai.maxageinterval_id = ccmax.classificationcode_id
  AND ccmin.urndomain      = 'ICS'
  AND ccmax.urndomain      = 'ICS';
 

  CREATE OR REPLACE FORCE VIEW "geologicunit" ("id", "textdescription", "geologicunittype", "rank", "rank_codespace", "observationmethod", "observationmethod_codespace", "purpose") AS 
  SELECT TO_CHAR(gf.id) AS id,
    gf.textdescription,
    cct.urn                        AS geologicunittype,
    ccr.name                       AS rank,
    csr.urn                        AS rank_codespace,
    'urn:ogc:def:nil:OGC::missing' AS observationmethod,
    'http://urn.opengis.net/'      AS observationmethod_codespace,
    ccp.synonyms                   AS purpose
  FROM geologicalfeature gf,
    geologicalunit gu,
    classificationcode_urn cct,
    classificationcode ccr,
    classificationscheme_urn csr,
    classificationcode ccp
  WHERE gf.featuretype_id         = 28
  AND gf.geologicalconcept_id     = gu.id
  AND gu.type_id                  = cct.classificationcode_id
  AND gu.rank_id                  = ccr.id
  AND ccr.classificationscheme_id = csr.classificationscheme_id
  AND cct.urndomain               = 'CGI'
  AND csr.urndomain               = 'GSV'
  AND gf.role_id                  = ccp.id;
 

