  CREATE OR REPLACE FORCE VIEW "gmlname" ("id", "geologicalfeature_id", "value", "codespace") AS 
  (
  (SELECT CAST(gf.id AS VARCHAR2(100)) AS id,
    TO_CHAR(gf.id)                     AS geologicalfeature_id,
    'urn:cgi:feature:GSV:Contact:'
    || gf.id                          AS value,
    'http://www.ietf.org/rfc/rfc2141' AS codespace
  FROM geologicalfeature gf
  WHERE gf.featuretype_id = 34
  UNION
  SELECT CAST(gf.id AS VARCHAR2(100)) AS id,
    TO_CHAR(gf.id)                    AS geologicalfeature_id,
    'urn:cgi:feature:GSV:GeologicUnit:'
    || gf.id                          AS value,
    'http://www.ietf.org/rfc/rfc2141' AS codespace
  FROM geologicalfeature gf
  WHERE gf.featuretype_id = 28
  )
UNION
SELECT CAST(gf.id AS VARCHAR2(100)) AS id,
  TO_CHAR(gf.id)                    AS geologicalfeature_id,
  'urn:cgi:feature:GSV:ShearDisplacementStructure:'
  || gf.id                          AS value,
  'http://www.ietf.org/rfc/rfc2141' AS codespace
FROM geologicalfeature gf
WHERE gf.featuretype_id = 35)
UNION
