      || ' (')
      || gcn.abbreviation)
      || ')')
      || ' [previous name]'
    WHEN gcn.enddate       IS NOT NULL
    AND gf.descriptivename IS NULL
    AND gcn.abbreviation   IS NULL
    THEN gcn.name
      || ' [previous name]'
    ELSE NULL
  END) AS VARCHAR(1000))                      AS value,
  'http://www.dpi.vic.gov.au/earth-resources' AS codespace
FROM geologicalfeature gf,
  geologicalconcept_name gcn
WHERE gf.geologicalconcept_id = gcn.geologicalconcept_id;
 

  CREATE OR REPLACE FORCE VIEW "hangingwalldirection" ("id", "displacementvalue_id", "value", "codespace") AS 
  SELECT TO_CHAR(dva.id)              AS id,
    TO_CHAR(dva.displacementvalue_id) AS displacementvalue_id,
    cc.name                           AS value,
    cs.urn                            AS codespace
  FROM displacementvalue_attribute dva,
    classificationcode cc,
    classificationscheme_urn cs
  WHERE dva.name_id              = 51
  AND dva.value01_id             = cc.id
  AND cc.classificationscheme_id = cs.classificationscheme_id;
 

  CREATE OR REPLACE FORCE VIEW "lithology" ("material_id", "lithology") AS 
  SELECT DISTINCT TO_CHAR(ema.earthmaterial_id) AS material_id,
    cc.urn                                      AS lithology
  FROM earthmaterial_attribute ema,
    classificationcode_urn cc
  WHERE ema.name_id  = 24642
  AND ema.value01_id = cc.classificationcode_id
  AND cc.urndomain   = 'CGI'
  ORDER BY ema.earthmaterial_id,
    cc.urn;
 

  CREATE OR REPLACE FORCE VIEW "magneticsusceptibility" ("id", "physicaldescription_id", "value01", "value01_uom", "value02", "value02_uom") AS 
  SELECT TO_CHAR(gfa.id)              AS id,
    TO_CHAR(gfa.geologicalfeature_id) AS physicaldescription_id,
    qv1.value                         AS value01,
    'urn:ogc:def:uom:UCUM::SI'        AS value01_uom,
    qv2.value                         AS value02,
    CASE
      WHEN qv2.value IS NULL
      THEN NULL
      ELSE 'urn:ogc:def:uom:UCUM::SI'
    END AS value02_uom
  FROM geologicalfeature_attribute gfa
  LEFT JOIN quantityvalue qv2
  ON gfa.value02_id = qv2.id,
    classificationcode cc,
    quantityvalue qv1
  WHERE gfa.name_id = cc.id
  AND lower(cc.name) LIKE '%magnetic susceptibility%'
  AND gfa.value01_id = qv1.id
  UNION
  SELECT TO_CHAR(ema.id)          AS id,
    TO_CHAR(ema.earthmaterial_id) AS physicaldescription_id,
    qv1.value                     AS value01,
    'urn:ogc:def:uom:UCUM::SI'    AS value01_uom,
    qv2.value                     AS value02,
    CASE
      WHEN qv2.value IS NULL
      THEN NULL
      ELSE 'urn:ogc:def:uom:UCUM::SI'
    END AS value02_uom
  FROM earthmaterial_attribute ema
  LEFT JOIN quantityvalue qv2
  ON ema.value02_id = qv2.id,
    classificationcode cc,
    quantityvalue qv1
  WHERE ema.name_id = cc.id
  AND lower(cc.name) LIKE '%magnetic susceptibility%'
  AND ema.value01_id = qv1.id;
 

