  CREATE OR REPLACE FORCE VIEW "mappedfeature_contact" ("id", "geologicalfeature_id", "positionalaccuracy", "positionalaccuracy_codespace", "samplingframe", "specification", "shape") AS 
  SELECT CAST(mf.id AS                                VARCHAR2(50))   AS id,
    CAST(gf.id AS                                     VARCHAR2(50))   AS geologicalfeature_id,
    CAST(cc.name AS                                   VARCHAR2(1000)) AS positionalaccuracy ,
    CAST(cs.urn AS                                    VARCHAR2(1000)) AS positionalaccuracy_codespace,
    CAST('urn:cgi:feature:CGI:EarthNaturalSurface' AS VARCHAR2(150))  AS samplingframe,
