  CREATE OR REPLACE FORCE VIEW "observationmethod" ("id", "valueowner_id", "value", "codespace") AS 
  SELECT CAST((
    CASE
      WHEN im.interpretationmethod_id IS NULL
      THEN CAST(mf.id AS VARCHAR2(100))
      ELSE (((mf.id
        || '.')
        || im.interpretationmethod_id))
    END) AS       VARCHAR2(100)) AS id,
    CAST(mf.id AS VARCHAR2(100)) AS valueowner_id,
    CAST((
    CASE
      WHEN im.interpretationmethod_id IS NULL
      THEN 'urn:ogc:def:nil:OGC::missing'
      ELSE CAST(cc.name AS VARCHAR2(500))
    END) AS VARCHAR2(2000)) AS value,
    CAST((
    CASE
      WHEN im.interpretationmethod_id IS NULL
      THEN 'http://urn.opengis.net'
      ELSE CAST(cs.urn AS VARCHAR2(500))
    END) AS VARCHAR(2000)) AS codespace
  FROM mappedfeature_geolunit mf
  LEFT JOIN (mf_gu_interpmethod im
  LEFT JOIN (classificationcode cc
  LEFT JOIN classificationscheme_urn cs
  ON cc.classificationscheme_id = cs.classificationscheme_id)
  ON im.interpretationmethod_id = cc.id)
  ON mf.id                      = im.mappedfeature_id
  UNION
  SELECT CAST((
    CASE
      WHEN im.interpretationmethod_id IS NULL
      THEN CAST(mf.id AS VARCHAR(100))
      ELSE (((mf.id
        || '.')
        || im.interpretationmethod_id))
    END) AS       VARCHAR2(100)) AS id,
    CAST(mf.id AS VARCHAR2(100)) AS valueowner_id,
    CAST((
    CASE
      WHEN im.interpretationmethod_id IS NULL
      THEN 'urn:ogc:def:nil:OGC::missing'
      ELSE CAST(cc.name AS VARCHAR(500))
    END) AS VARCHAR2(2000)) AS value,
    CAST((
    CASE
      WHEN im.interpretationmethod_id IS NULL
      THEN 'http://urn.opengis.net'
      ELSE CAST(cs.urn AS VARCHAR2(500))
    END) AS VARCHAR2(2000)) AS codespace
  FROM mappedfeature_geolstructure mf
  LEFT JOIN (mf_gs_interpmethod im
  LEFT JOIN (classificationcode cc
  LEFT JOIN classificationscheme_urn cs
  ON cc.classificationscheme_id = cs.classificationscheme_id)
  ON im.interpretationmethod_id = cc.id)
  ON mf.id                      = im.mappedfeature_id;
 

