  CREATE OR REPLACE FORCE VIEW "physicaldescription" ("id", "valueowner_type") AS 
  SELECT TO_CHAR(geologicalfeature.id) AS id,
    'geologicunit'                     AS valueowner_type
  FROM geologicalfeature
  WHERE (geologicalfeature.id IN
    ( SELECT "density"."physicaldescription_id" FROM "density"
    ))
  OR (geologicalfeature.id IN
    (SELECT "magneticsusceptibility"."physicaldescription_id"
    FROM "magneticsusceptibility"
    ))
  UNION
  SELECT TO_CHAR(em.id) AS id,
    'rockmaterial'      AS valueowner_type
  FROM earthmaterial em
  WHERE (em.id IN
    ( SELECT "density"."physicaldescription_id" FROM "density"
    ))
  OR (em.id IN
    (SELECT "magneticsusceptibility"."physicaldescription_id"
    FROM "magneticsusceptibility"
    ));
 


 

