 CREATE OR REPLACE FORCE VIEW "view_displacementvalue" ("id", "valueowner_id", "valueowner_type", "hwd_value", "hwd_codespace", "ms_value", "ms_codespace", "mt_value", "mt_codespace") AS 
  SELECT TO_CHAR(q.id),
    TO_CHAR(q.valueowner_id),
    q.valueowner_type,
    hwd."value"     AS hwd_value,
    hwd."codespace" AS hwd_codespace,
    ms."value"      AS ms_value,
    ms."codespace"  AS ms_codespace,
    mt."value"      AS mt_value,
    mt."codespace"  AS mt_codespace
  FROM
    (SELECT dv.id     AS id,
      'geologicevent' AS valueowner_type,
      ge.id           AS valueowner_id
    FROM displacementvalue dv,
      geologicalevent ge
    WHERE dv.id = ge.incrementaldisplacement_id
    UNION
    SELECT dv.id                   AS id,
      'sheardisplacementstructure' AS valueowner_type,
      gf.geologicalfeature_id      AS valueowner_id
    FROM displacementvalue dv,
      geologicalfeature_attribute gf
    WHERE dv.id = gf.value01_id
    ) q
  LEFT JOIN "hangingwalldirection" hwd
  ON q.id = hwd."displacementvalue_id",
    "movementsense" ms,
    "movementtype" mt
  WHERE q.id = ms."displacementvalue_id"
  AND q.id   = mt."displacementvalue_id";
  
  CREATE OR REPLACE FORCE VIEW "VIEW_DISPLACEMENTEVENT" ("GEOLOGICEVENT_ID","FULL_GEOLOGICEVENT_ID", "GEOLOGICALFEATURE_ID", "MINAGE", "MAXAGE", "CODESPACE", "EVENTORDER", "PREFERREDEVENT_ID", "DISPLACEMENTVALUE_ID", "VALUEOWNER_ID", "VALUEOWNER_TYPE", "HWD_VALUE", "HWD_CODESPACE", "MS_VALUE", "MS_CODESPACE", "MT_VALUE", "MT_CODESPACE") AS 
  SELECT TO_CHAR(ge."id") AS geologicevent_id,
	'gsml.displacementevent.' || TO_CHAR(ge."id") as full_geologicevent_id,
    TO_CHAR(ge."geologicalfeature_id") as geologicalfeature_id,
    ge."minage",
    ge."maxage",
    ge."codespace",
    ge."eventorder",
    TO_CHAR(ge."preferredevent_id") as preferredevent_id,
    gv."id" AS displacementvalue_id,
    TO_CHAR(gv."valueowner_id") as valueowner_id,
    TO_CHAR(gv."valueowner_type") as valueowner_type,
    gv."hwd_value",
    gv."hwd_codespace",
    gv."ms_value",
    gv."ms_codespace",
    gv."mt_value",
    gv."mt_codespace"
  FROM "geologicevent" ge
  LEFT JOIN "view_displacementvalue" gv
  ON ge."id" = gv."valueowner_id";
 
 CREATE OR REPLACE FORCE VIEW "view_displacementevent" ("geologicevent_id","full_geologicevent_id", "geologicalfeature_id", "minage", "maxage", "codespace", "eventorder", "preferredevent_id", "displacementvalue_id", "valueowner_id", "valueowner_type", "hwd_value", "hwd_codespace", "ms_value", "ms_codespace", "mt_value", "mt_codespace") AS 
  SELECT TO_CHAR(ge."id") AS geologicevent_id,
	'gsml.displacementevent.' || TO_CHAR(ge."id") as full_geologicevent_id,
    TO_CHAR(ge."geologicalfeature_id") as geologicalfeature_id,
    ge."minage",
    ge."maxage",
    ge."codespace",
    ge."eventorder",
    TO_CHAR(ge."preferredevent_id") as preferredevent_id,
    gv."id" AS displacementvalue_id,
    TO_CHAR(gv."valueowner_id") as valueowner_id,
    TO_CHAR(gv."valueowner_type") as valueowner_type,
    gv."hwd_value",
    gv."hwd_codespace",
    gv."ms_value",
    gv."ms_codespace",
    gv."mt_value",
    gv."mt_codespace"
  FROM "geologicevent" ge
  LEFT JOIN "view_displacementvalue" gv
  ON ge."id" = gv."valueowner_id";
 
 
  CREATE OR REPLACE FORCE VIEW "view_displacementstructname" ("sheardisplacementstructure_id", "full_sds_id", "textdescription", "observationmethod", "observationmethod_codespace", "purpose", "name_id", "geologicalfeature_id", "value", "codespace", "preferredevent_id", "geologicevent_id") AS 
  SELECT TO_CHAR(sds."id") AS sheardisplacementstructure_id,
	'gsml.sheardisplacementstructure.' || TO_CHAR(sds."id") as full_sds_id,
    sds."textdescription",
    sds."observationmethod",
    sds."observationmethod_codespace",
    sds."purpose",
    gn."id" AS name_id,
    TO_CHAR(gn."geologicalfeature_id") as geologicalfeature_id,
    gn."value",
    gn."codespace",
    TO_CHAR(ge."preferredevent_id") as preferredevent_id,
    TO_CHAR(ge."id") AS geologicevent_id
  FROM "sheardisplacementstructure" sds
  LEFT JOIN "gmlname" gn
  ON gn."geologicalfeature_id" = sds."id"
  LEFT JOIN "geologicevent" ge
  ON ge."geologicalfeature_id"  = sds."id"
  AND ge."preferredevent_id" IS NOT NULL
  ORDER BY sds."id";
 

  CREATE OR REPLACE FORCE VIEW "VIEW_DISPLACEMENTSTRUCTNAME" ("SHEARDISPLACEMENTSTRUCTURE_ID", "FULL_SDS_ID", "TEXTDESCRIPTION", "OBSERVATIONMETHOD", "OBSERVATIONMETHOD_CODESPACE", "PURPOSE", "NAME_ID", "GEOLOGICALFEATURE_ID", "VALUE", "CODESPACE", "PREFERREDEVENT_ID", "GEOLOGICEVENT_ID") AS 
  SELECT TO_CHAR(sds."id") AS sheardisplacementstructure_id,
	'gsml.sheardisplacementstructure.' || TO_CHAR(sds."id") as full_sds_id,
    sds."textdescription",
    sds."observationmethod",
    sds."observationmethod_codespace",
    sds."purpose",
    gn."id" AS name_id,
    TO_CHAR(gn."geologicalfeature_id") as geologicalfeature_id,
    gn."value",
    gn."codespace",
    TO_CHAR(ge."preferredevent_id") as preferredevent_id,
    TO_CHAR(ge."id") AS geologicevent_id
  FROM "sheardisplacementstructure" sds
  LEFT JOIN "gmlname" gn
  ON gn."geologicalfeature_id" = sds."id"
  LEFT JOIN "geologicevent" ge
  ON ge."geologicalfeature_id"  = sds."id"
  AND ge."preferredevent_id" IS NOT NULL
  ORDER BY sds."id";
 

 
 

  CREATE OR REPLACE FORCE VIEW "view_geologicunit" ("id","full_id", "textdescription", "geologicunittype", "rank", "rank_codespace", "observationmethod", "observationmethod_codespace", "purpose", "name_value", "name_codespace","age", "preferredevent_id") AS 
  SELECT TO_CHAR(gu."id"),
	'gsml.geologicunit.' || TO_CHAR(gu."id") as full_id,
    gu."textdescription",
    gu."geologicunittype",
    gu."rank",
    gu."rank_codespace",
    gu."observationmethod",
    gu."observationmethod_codespace",
    gu."purpose",
    gn."value"     AS name_value,
    gn."codespace" AS name_codespace,
	TO_CHAR(ge."id") as age,
    TO_CHAR(ge."preferredevent_id")
  FROM "geologicunit" gu
  LEFT JOIN "gmlname" gn
  ON gn."geologicalfeature_id" = gu."id"
  LEFT JOIN "geologicevent" ge
  ON ge."geologicalfeature_id" = gu."id"
  order by gu."id";
 

  CREATE OR REPLACE FORCE VIEW "VIEW_GEOLOGICUNIT" ("ID","FULL_ID", "TEXTDESCRIPTION", "GEOLOGICUNITTYPE", "RANK", "RANK_CODESPACE", "OBSERVATIONMETHOD", "OBSERVATIONMETHOD_CODESPACE", "PURPOSE", "NAME_VALUE", "NAME_CODESPACE","AGE", "PREFERREDEVENT_ID") AS 
  SELECT TO_CHAR(gu."id"),
  'gsml.geologicunit.' || TO_CHAR(gu."id") as full_id,
    gu."textdescription",
    gu."geologicunittype",
    gu."rank",
    gu."rank_codespace",
    gu."observationmethod",
    gu."observationmethod_codespace",
    gu."purpose",
    gn."value"     AS name_value,
    gn."codespace" AS name_codespace,
	TO_CHAR(ge."id") as age,
    TO_CHAR(ge."preferredevent_id")
  FROM "geologicunit" gu
  LEFT JOIN "gmlname" gn
  ON gn."geologicalfeature_id" = gu."id"
  LEFT JOIN "geologicevent" ge
  ON ge."geologicalfeature_id" = gu."id"  
  order by gu."id";
 

  CREATE OR REPLACE FORCE VIEW "view_mappedfeature" ("mappedfeature_id", "geologicalfeature_id", "positionalaccuracy", "positionalaccuracy_codespace", "samplingframe", "specification", "shape", "observationmethod_id", "valueowner_id", "value", "codespace") AS 
  SELECT mc."id" AS mappedfeature_id,
    mc."geologicalfeature_id",
    mc."positionalaccuracy",
    mc."positionalaccuracy_codespace",
    mc."samplingframe",
    mc."specification",
    mc."shape",
    om."id" AS observationmethod_id,
    om."valueowner_id",
    om."value",
    om."codespace"
  FROM "mappedfeature" mc
  LEFT JOIN "observationmethod" om
  ON om."valueowner_id" = mc."id"
  ORDER BY mc."id",
    om."id";
 

  CREATE OR REPLACE FORCE VIEW "VIEW_MAPPEDFEATURE" ("MAPPEDFEATURE_ID", "GEOLOGICALFEATURE_ID", "POSITIONALACCURACY", "POSITIONALACCURACY_CODESPACE", "SAMPLINGFRAME", "SPECIFICATION", "SHAPE", "OBSERVATIONMETHOD_ID", "VALUEOWNER_ID", "VALUE", "CODESPACE") AS 
  SELECT mc."id" AS mappedfeature_id,
    mc."geologicalfeature_id",
    mc."positionalaccuracy",
    mc."positionalaccuracy_codespace",
    mc."samplingframe",
    mc."specification",
    mc."shape",
    om."id" AS observationmethod_id,
    om."valueowner_id",
    om."value",
    om."codespace"
  FROM "mappedfeature" mc
  LEFT JOIN "observationmethod" om
  ON om."valueowner_id" = mc."id"
  ORDER BY mc."id",
    om."id";
 

 
 

  CREATE OR REPLACE FORCE VIEW "view_mineral" ("id","full_id", "mineralname", "mineralname_codespace", "purpose", "urn_mineralname", "material_id") AS 
  SELECT TO_CHAR(m."id"),
	'gsml.mineral.' || TO_CHAR(m."id") as full_id,
    m."mineralname",
    m."mineralname_codespace",
    m."purpose",
    mn."mineralname" AS urn_mineralname,
    TO_CHAR(mn."material_id")
  FROM "mineral" m
  LEFT JOIN "mineralname" mn
  ON mn."material_id" = m."id"
  ORDER BY m."id";
 

  CREATE OR REPLACE FORCE VIEW "VIEW_MINERAL" ("ID","FULL_ID" ,"MINERALNAME", "MINERALNAME_CODESPACE", "PURPOSE", "URN_MINERALNAME", "MATERIAL_ID") AS 
  SELECT TO_CHAR(m."id"),
	'gsml.mineral.' || TO_CHAR(m."id") as full_id,
    m."mineralname",
    m."mineralname_codespace",
    m."purpose",
    mn."mineralname" AS urn_mineralname,
    TO_CHAR(mn."material_id")
  FROM "mineral" m
  LEFT JOIN "mineralname" mn
  ON mn."material_id" = m."id"
  ORDER BY m."id";
 

  CREATE OR REPLACE FORCE VIEW "view_physicaldescription" ("id", "density_value01", "density_value01_uom", "density_value02", "density_value02_uom", "mag_value01", "mag_value01_uom", "mag_value02", "mag_value02_uom") AS 
  SELECT TO_CHAR(pd."id"),
    d."value01"     AS density_value01,
    d."value01_uom" AS density_value01_uom,
    d."value02"     AS density_value02,
    d."value02_uom" AS density_value02_uom,
    m."value01"     AS mag_value01,
    m."value01_uom" AS mag_value01_uom,
    m."value02"     AS mag_value02,
    m."value02_uom" AS mag_value02_uom
  FROM "physicaldescription" pd
  LEFT JOIN "density" d
  ON d."physicaldescription_id" = pd."id"
  LEFT JOIN "magneticsusceptibility" m
  ON m."physicaldescription_id" = pd."id"
  ORDER BY pd."id";
 

  CREATE OR REPLACE FORCE VIEW "VIEW_PHYSICALDESCRIPTION" ("ID", "DENSITY_VALUE01", "DENSITY_VALUE01_UOM", "DENSITY_VALUE02", "DENSITY_VALUE02_UOM", "MAG_VALUE01", "MAG_VALUE01_UOM", "MAG_VALUE02", "MAG_VALUE02_UOM") AS 
  SELECT TO_CHAR(pd."id"),
    d."value01"     AS density_value01,
    d."value01_uom" AS density_value01_uom,
    d."value02"     AS density_value02,
    d."value02_uom" AS density_value02_uom,
    m."value01"     AS mag_value01,
    m."value01_uom" AS mag_value01_uom,
    m."value02"     AS mag_value02,
    m."value02_uom" AS mag_value02_uom
  FROM "physicaldescription" pd
  LEFT JOIN "density" d
  ON d."physicaldescription_id" = pd."id"
  LEFT JOIN "magneticsusceptibility" m
  ON m."physicaldescription_id" = pd."id"
  ORDER BY pd."id";
 

  CREATE OR REPLACE FORCE VIEW "view_rockmaterial" ("id","full_id", "consolidationdegree", "consolidationdegree_codespace", "purpose", "lithology") AS 
  SELECT TO_CHAR(rm."id"),
	'gsml.rockmaterial.' || TO_CHAR(rm."id") as full_id,
    rm."consolidationdegree",
    rm."consolidationdegree_codespace",
    rm."purpose",
    l."lithology"
  FROM "rockmaterial" rm
  LEFT JOIN "lithology" l
  ON rm."id" = l."material_id"
  ORDER BY rm."id",
    l."material_id";
 

  CREATE OR REPLACE FORCE VIEW "VIEW_ROCKMATERIAL" ("ID","FULL_ID","CONSOLIDATIONDEGREE", "CONSOLIDATIONDEGREE_CODESPACE", "PURPOSE", "LITHOLOGY") AS 
  SELECT TO_CHAR(rm."id"),
	'gsml.rockmaterial.' || TO_CHAR(rm."id") as full_id,
    rm."consolidationdegree",
    rm."consolidationdegree_codespace",
    rm."purpose",
    l."lithology"
  FROM "rockmaterial" rm
  LEFT JOIN "lithology" l
  ON rm."id" = l."material_id"
  ORDER BY rm."id",
    l."material_id";
 

 
 
 
 
 
 
